import React from "react";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";

const pageone = () => {
  return (
    <div>
      <Link href="pagetwo">go to page 2</Link>
    </div>
  );
};

const pagetwo = () => {
  return (
    <div>
      <Link href="/">back to page 1</Link>
    </div>
  );
};
const App = () => {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/" exact element={pageone}>
            pageone
          </Route>
          <Route path="/pagetwo" element={pagtwo}>
            pageone
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default App;
